import { Route, Routes } from 'react-router-dom'
function App() {

    const linkedinUrl = 'https://www.linkedin.com/in/cole-kedzierski';
    const githubUrl = 'https://github.com/ColeKedz';

    return (
        <div className='App'>
            <header className="App-header">
                <h1>
                    Welcome to Cole's React.js Sandbox!
                </h1>
            </header>

            <nav id='navContainer'>
                <ul>
                    <li ><a className='navFonts' href={linkedinUrl} target='_blank' rel='noreferrer' >Linkedin</a></li>
                    <li><a id='GitHub' class='navFonts' href={githubUrl} target='_blank' rel='noreferrer'>GitHub</a></li>
                    <Route path="/"></Route>
                </ul>
            </nav>

        </div>

    );
}

export default App;
